import React, { Component } from "react";
import "./Header.css";

class Header extends Component {
  state = {};
  render() {
    return (
      <div className="header">
        <nav>
          <a href="/html/">HTML</a> |<a href="/css/">CSS</a> |
          <a href="/js/">JavaScript</a> |<a href="/jquery/">jQuery</a>
        </nav>
      </div>
    );
  }
}

export default Header;
